import { Box, Button, Grid, makeStyles } from "@material-ui/core"
import AddIcon from '@material-ui/icons/Add';

const useStyles = makeStyles({
    paddingTop10: {
        paddingTop: "10%",
    },
    alingPaper: {
        padding: 20, 
        textAlign: 'center',
    },
    box: {
        backgroundColor: "#E1E1E1"
    },
    height100: {
        height: "80vh"
    },
    button: {
        width: "20px",
        height: "20px"
    }
})

function GridTask({title, onHandleClick}){
    const classes = useStyles()

    return(
        <>
            <Box className={`${classes.alingPaper} ${classes.box} ${classes.height100}`}>
                {title}
            </Box>
            <Box className={`${classes.box} `}>
                <Button onClick={onHandleClick} className={classes.button}>
                    <AddIcon/>
                </Button> 
            </Box>
        </>
    )

}
export default GridTask
